const API = "https://bootcamp-api.codeit.kr";

async function getUserData(url) {
  try {
    const response = await fetch(API + `${url}`);
    const result = await response.json();
    return result;
  } catch (error) {
    console.error(error);
  }
}

export default getUserData;
